import { useState } from "react";
import { data } from "./data";
import {useForm} from "react-hook-form"
import axios from "axios"
function App() {
  const{register,handleSubmit,formState:{errors},getValues,setValue,reset}=useForm();
  const[data,setData]=useState({})

  const hh=async(data)=>{
    await axios.post("http://localhost:3001/add",{data}).then((res)=>{
      console.log(res.data)
    })

  }
  return (
    <>
    <form action="" onSubmit={handleSubmit(hh)} className="flex flex-col border-2 w-72">
      <input className="border-[1px] border-black" type="text" {...register("name",{required:true})} />
      {errors.name && <span className="text-red-500 ">Field Rquired</span>}
      <input {...register("email")} className="border-[1px] border-black"/>
     <div>
     <input type="radio" {...register("gender")} value="yes" /><label>Yes</label>
     <input type="radio" {...register("gender")} value="no" /><label>No</label>
     </div>
      <input type="submit" value="Submit" />

      <h3>{JSON.stringify(data)}</h3>
    </form>
    </>
  );
}

export default App;
